import { Container } from "react-bootstrap";
import BaseLayout from "../BaseLayout";
import FoldersHeaderBar from "../components/shared/Cudzoziemcy/FoldersHeaderBar";
import FoldersMainContent from "../components/shared/Cudzoziemcy/FoldersMainContent";

const FoldersPageLayout = () => {
  return (
    <BaseLayout title="Katalog spraw">
      <Container className="wrapper">
        <FoldersHeaderBar />
        <FoldersMainContent />
      </Container>
    </BaseLayout>
  );
};

export default FoldersPageLayout;
